import './App.scss';
import { Routes, Route} from 'react-router-dom'
import React from 'react';
import Layout from './Components/Layout';
import Home from './Components/Home';

function App()
{
  return (
    <>
      <Routes>
      <Route path="/layout " element={<Layout />} />
      <Route path="/home" element={<Home />} />
      </Routes>
    </>
    )
}


export default App
